webpackJsonp([91691008827692],{397:function(a,e){a.exports={data:{markdownRemark:{html:'<p>ABC is the commandline interface for working with appbase.io.</p>\n<p><img src="https://i.imgur.com/vBByTd0.png"></p>\n<h3 id="download-from-github-or-get-the-docker-image"><a href="#download-from-github-or-get-the-docker-image" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><a href="https://github.com/appbaseio/abc/releases/tag/0.4.1">Download from github</a> or <a href="https://hub.docker.com/r/appbaseio/abc/">get the Docker Image</a>.</h3>\n<h2 id="how-it-works"><a href="#how-it-works" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>How It Works</h2>\n<p>ABC allows creating apps, accessing credentials, viewing usage metrics and importing data from sources like JSON, CSV, MongoDB, SQL into appbase.io. Here is a sneak peek of how it works:</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code class="gatsby-code-bash">$ abc\nUSAGE\n  abc <span class="token operator">&lt;</span>command<span class="token operator">></span> <span class="token punctuation">[</span>flags<span class="token punctuation">]</span>\n\nCOMMANDS\n  login     login into appbase.io\n  user      get user details\n  apps      display user apps\n  app       display app details\n  create    create app\n  delete    delete app\n  <span class="token function">logout</span>    <span class="token function">logout</span> session\n  <span class="token function">import</span>    <span class="token function">import</span> data to appbase app\n  version   show build details\nRun <span class="token string">\'abc COMMAND --help\'</span> <span class="token keyword">for</span> <span class="token function">more</span> information on a command.\n</code></pre>\n      </div>\n<p>You can <code class="gatsby-code-text">login</code> right from the convenience of the CLI. Once you are logged in, you can check the <code class="gatsby-code-text">user</code> info as follows:</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code class="gatsby-code-bash">$ abc user\nNAME:  Siddharth Kothari\nEMAIL: siddharth@appbase.io\nAPPS:\n+------+--------------------------+\n<span class="token operator">|</span>  ID  <span class="token operator">|</span>           NAME           <span class="token operator">|</span>\n+------+--------------------------+\n<span class="token operator">|</span> 7184 <span class="token operator">|</span> newsave                  <span class="token operator">|</span>\n<span class="token operator">|</span> 6986 <span class="token operator">|</span> example-app01            <span class="token operator">|</span>\n<span class="token punctuation">..</span>.\n+------+--------------------------+\n</code></pre>\n      </div>\n<p>Now, let’s try to view the usage <code class="gatsby-code-text">metrics</code> of the <strong>example-app01</strong> app. (You can also use the app id instead of the app name in the following command.)</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code class="gatsby-code-bash">$ abc app example-app01 --metrics\nID:         6986\nName:       example-app01\nOwner:      siddharth@appbase.io\nUsers:      siddharth@appbase.io\nES Version: 2.4\nCreated on: Fri Jul 21 16:05:29 2017\n\nStorage<span class="token punctuation">(</span>KB<span class="token punctuation">)</span>: 3\nRecords:     1\n+-------------+-----------+\n<span class="token operator">|</span>    DATE     <span class="token operator">|</span> API CALLS <span class="token operator">|</span>\n+-------------+-----------+\n<span class="token operator">|</span> 2017-Jul-21 <span class="token operator">|</span>     5     <span class="token operator">|</span>\n+-------------+-----------+\n<span class="token operator">|</span>    TOTAL    <span class="token operator">|</span>     5     <span class="token operator">|</span>\n+-------------+-----------+\n</code></pre>\n      </div>\n<p>The <code class="gatsby-code-text">app</code> command also has a flag <code class="gatsby-code-text">--creds</code> for viewing the app’s credentials and a flag <code class="gatsby-code-text">--data-view</code> to open the app’s data in the data browser.</p>\n<p>Finally, let’s create a new app, we will call it <code class="gatsby-code-text">abc-demo</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code class="gatsby-code-bash">$ abc create abc-demo\n<span class="token punctuation">(</span>master<span class="token punctuation">)</span>\nID:    8499\nName:  abc-demo\nAdmin API key: 67yS0tlsG:b25979f0-15c4-4c37-ab60-a3e22dcc40a0\nRead-only API key: UlSDP7x3r:fc123d3e-1d17-4c66-bffa-d04cbad581a0\n</code></pre>\n      </div>\n<p>Deleting is pretty nifty too with <code class="gatsby-code-text">delete</code>, BE CAREFUL as it doesn’t require a confirmation before deleting an app.</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code class="gatsby-code-bash">$ abc delete abc-demo\nApp Deleted\n</code></pre>\n      </div>\n<h3 id="importing-data"><a href="#importing-data" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Importing Data</h3>\n<p>Last but not least, the <code class="gatsby-code-text">import</code> command allows importing data from sources like Postgres, MongoDB, MySQL, SQL Server, JSON and CSV into your appbase.io app.</p>\n<p>Here is an example import command showing data from MySQL being imported to an appbased.io app.</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code class="gatsby-code-bash">abc <span class="token function">import</span> --src_type<span class="token operator">=</span>mysql --src_uri<span class="token operator">=</span><span class="token string">"USER:PASS@tcp(HOST:PORT)/DBNAME"</span> <span class="token string">"https://USER:PASS@scalr.api.appbase.io/APPNAME"</span>\n</code></pre>\n      </div>\n<p><code class="gatsby-code-text">import</code> uses the <code class="gatsby-code-text">--src_type</code> and <code class="gatsby-code-text">--src_uri</code> switches to set the source database. It takes a required destination URL for the appbase.io app (or Elasticsearch index) into which the data is being imported to. You can follow this step-by-step guide for <a href="https://medium.appbase.io/cli-for-indexing-data-from-mysql-to-elasticsearch-b59289e5025d">importing data from MySQL</a>.</p>\n<p>Since the <code class="gatsby-code-text">import</code> command can do so many things, we have a dedicated post explaining <a href="https://medium.appbase.io/abc-import-import-your-mongodb-sql-json-csv-data-into-elasticsearch-a202cafafc0d">how it works</a>.</p>\n<p>Other specific guides:</p>\n<ol>\n<li><a href="https://medium.appbase.io/cli-for-indexing-data-from-mongodb-to-elasticsearch-ee5a74695945">Importing your MongoDB data</a>  </li>\n<li><a href="https://medium.appbase.io/cli-for-indexing-data-from-postgres-to-elasticsearch-6eebc5cc0f0f">Importing your Postgres data</a>  </li>\n<li><a href="https://medium.appbase.io/cli-for-indexing-data-from-mssql-to-elasticsearch-341963a054dd">Importing data from MS SQL</a>  </li>\n<li><a href="https://medium.appbase.io/cli-for-indexing-data-from-elasticsearch-to-elasticsearch-301c7a243c84">Importing data from one Elasticsearch to another</a>  </li>\n<li><a href="https://medium.appbase.io/cli-for-indexing-data-from-json-to-elasticsearch-92f582c53df4">Importing JSON files</a>  </li>\n<li><a href="https://medium.appbase.io/cli-for-indexing-data-from-csv-to-elasticsearch-17d290a5974f">Importing CSV files</a></li>\n</ol>',frontmatter:{title:"ABC - Appbase.io via Commandline",next:"go-quickstart.html",prev:"rest-quickstart.html",nextTitle:"Golang Quickstart",prevTitle:"REST API - Quickstart"},fields:{path:"docs/rest/abc.md",slug:"abc.html"}}},pathContext:{slug:"abc.html"}}}});
